This torrent contains the first 181 episodes of Looking for Group for easy viewing.

LFG or &quot;Looking for group&quot; is a comic based on World of Warcraft but at the same time very different from that universe. The story unfolds around Richard, a homicidal Undead Warlock, and Cale'anon a naive hippyesque elf who wants to better the world. The humor is pretty dark at times but the comic is pretty damn addictive. Since its launch on November 26, 2006 (witch was exactly my 18th birthday), it has received positive attention at the Dungeons &amp; Dragons and the World of Warcraft community.
